('1520388916.2460', 'Contact Us', 'contact-email', 'fumihiro.yano@lixil.com', 3, NULL),
('1520388916.2460', 'Contact Us', 'message', '担当者様\r\n\r\n４月１０日チェックイン、４月１３日チェックアウトの\r\n３泊４日でスタンダードの部屋を仮予約できればと思っています。\r\n\r\n空き状況・予約をできるかなど情報をいただけますか。\r\nよろしくお願いします。\r\n\r\n矢野', 4, NULL),
('1520388916.2460', 'Contact Us', 'Submitted From', '118.201.186.10', 10000, NULL),
('1520656216.1255', 'Contact Us', 'company-name', 'たかはし　みつえ', 0, NULL),
('1520656216.1255', 'Contact Us', 'your-name', 'ないです', 1, NULL),
('1520656216.1255', 'Contact Us', 'phone', '84906546409', 2, NULL),
('1520656216.1255', 'Contact Us', 'contact-email', 'mitsue_m_21@yahoo.co.jp', 3, NULL),
('1520656216.1255', 'Contact Us', 'message', 'お世話になります。\r\n\r\nエクスペディアで予約しました、たかはしです。\r\nリクエストしたいので、ご連絡いたしました。\r\n氏名　MITSUE TAKAHASHI\r\n予約番号 7335797213463　\r\n日程　2018年３月16日　１泊\r\n\r\n・禁煙の部屋\r\n・高層階\r\n・浴槽のある部屋\r\n・静かな階\r\n・もし無料で可能であれば、アーリーチェックイン\r\nお手数おかけします。どうぞよろしくお願い致します。\r\n　\r\nたかはしみつえ\r\n', 4, NULL),
('1520656216.1255', 'Contact Us', 'Submitted From', '42.112.84.240', 10000, NULL),
('1520930420.3262', 'Contact Us', 'company-name', '安田', 0, NULL),
('1520930420.3262', 'Contact Us', 'your-name', 'Grandtag', 1, NULL),
('1520930420.3262', 'Contact Us', 'phone', '85212345678', 2, NULL),
('1520930420.3262', 'Contact Us', 'contact-email', 'mkt_jpn@grandtag.com', 3, NULL),
('1520930420.3262', 'Contact Us', 'message', '海外在住の日本人の皆様へ\r\n\r\n\r\n初めまして、香港・シンガポールのアジア金融二大拠点に金融ライセンスを保有する香港Grandtag Financial Groupの安田と申します。\r\n\r\n週刊ベッターを拝見させて頂きました。\r\n\r\n\r\nこの度は、海外でご活躍されていらっしゃる日本人の皆様に向けて情報発信をさせて頂いております。\r\n\r\n個人して少しでもご興味をお持ちいただけるようでしたら幸いです。\r\n\r\n突然のご連絡となり大変恐縮ですが、一度お読み頂けましたら幸いです。\r\n\r\n\r\n\r\n日本は約20年間の長きに渡りゼロ金利の時代といわれ続けており、銀行預金も定期も生命保険も低金利時代となっております。\r\nまた、今後20年後も大きく改善するかというと、少子化、高齢化、年金減少など色々な問題を抱えており難しいのではないでしょうか。\r\n\r\nその間にも、どうしたら良いかと悩んでいる間に、多くの方が定年（60歳）になり、それまでに貯めておくはずだった老後資金（年金）が、用意できない事に気が付いても、後の祭りです。\r\n将来はもっと医療も発達し、ひと昔前と異なり、90歳や100歳まで生きる時代です。\r\n「その時に、残りの人生を生きていけるだけの資金があるか？」が非常に大事です。\r\n\r\nこの機会にぜひ、金融センター香港発の優れたプランを勉強してみませんか。\r\n\r\n今回は特別に、ご興味のある皆様に特設勉強ページをご用意致しましたので、下記リンクからご覧ください。\r\n※WEBページの内容は、許可なく転用を禁止致します。\r\nhttps://servicegta.wixsite.com/marketing/lp-ovs\r\n\r\n\r\n\r\n是非一度ご連絡をお待ちしております。\r\n\r\n\r\n日本人マーケット担当者　安田', 4, NULL),
