('1521104927.9780', 'Contact Us', 'message', 'ホーチミンによく出張してますが、昨年末から松乃井ホテルが気になっておりメールした次第です。\r\n以下について教えて頂きたく。\r\n①1泊の料金（1名宿泊）\r\n②長期で出張をするので2week以上になる場合宿泊料金がお得になりますか？\r\n③レイトチェックアウト可能ですか？\r\n④フリーランドリー枚数\r\n\r\n\r\n会社の基準としては$48/1day以下が目安です。\r\n\r\nよろしくお願いします。', 4, NULL),
