('1535424335.6406', 'Contact Us', 'message', '松乃井ホテル\r\nご担当者様\r\n\r\n突然のご連絡失礼致します。\r\n語学スクールSmile の村田と申します。\r\n\r\nこの度は、松乃井ホテル様のホテル内に\r\n弊社のチラシを設置して頂けないかと思い、ご連絡させて頂きました。\r\n\r\nチラシの内容は、駐在員の方向けにベトナム語レッスンのご案内です。\r\n松乃井ホテル様のアパートをご利用なされている駐在員様で\r\nベトナム語スクールを探している方に喜んでいただける内容かと思います。\r\n\r\nもし、設置が可能な場合でしたらチラシのデータを添付させて頂きますので、ご返信頂けますと幸いです。\r\nちなみにサイズはA6サイズ(10.5cm×14.8cm)となります。\r\n\r\nどうかご検討の程、よろしくお願い致します。\r\n\r\n村田\r\n\r\n＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝\r\n語学スクール　Smile\r\n村田朱音 (Akane Murata)\r\n\r\nMail : akane.murata@fois-vn.com\r\nTel : 0166-710-8079\r\n\r\nFois Smile Vietnam Company Limited\r\n200, D5 Street, Ward 25, Binh Thanh District, HCM City\r\nURL : http://fois-smile.com/jp/', 11, NULL),
