('1535522526.2748', 'Contact Us - EN', 'message', 'Dear Sir/Madam,\r\n\r\nI am messaging you regarding a possible collaboration with you when I travel to Saigon in July 2019 with my partner Tran (@wanderluster_tran).  \r\n\r\nYour hostel looks beautiful and I would love to promote you to my 39,535k travel followers via my Instagrams (@explorewithlee and @taketheleaptravel) through photos and instastories. My partner who has 15,200 travel followers will also be happy to do the same. \r\n\r\nMedia Kit:\r\n\r\nwww.instagram.com/explorewithlee\r\n\r\nwww.instagram.com/taketheleaptravel\r\n\r\nwww.instagram.com/wanderluster_tran \r\n\r\n39,535 followers combined. Plus 15,200 with my partners account - Total 54,735.\r\nTop Cities: London, Auckland, Melbourne, New York and Rio De Janerio\r\nTop Countries: USA, UK, New Zealand, Australia and Brazil\r\nAge Range: 30-54 years old\r\nRatio: 52% Male and 48% Female\r\nAverage Likes: 1400-2100\r\nImpressions: 5000-8000\r\nReach: 5000-6000\r\nComments: 500-1000\r\n\r\nI also run a luxury travel blog - www.taketheleaptravel.com and would happily write a review and direct my followers to your Instagram/website for places to stay in Saigon. I have 5500 subscribers and regular visitors daily.\r\nTop Countries to visit my blog are: New Zealand, UK, USA, Peru, Australia, Philippines, Indonesia and Canada\r\n\r\nAlongside this, I also blog twice a month for www.budgetair.co.uk and partake in takeovers for STA Travel which are both pretty big travel companies and I can get worldwide coverage for you through them. STA Travel alone have 91,200 followers and I would be able to tag your hostel and live stream it to their followers as well. \r\n\r\nI propose that in return for a few nights free stay we provide you with creative content such as photos, videos and instastories which we will post on our instagrams to our followers. Thus promoting your lovely hostel to all of our travel followers and directing them to stay with you. \r\n\r\nWe are currently already working alongside many luxury hotels and resorts such as: \r\n\r\nKabalana Hotel Sri Lanka, Velassaru Maldives, Munduk Moding Plantation Bali, Four Seasons Hong Kong, Frangipani Hotel El Nido, Radisson Blu Cebu, Diniview Villas Boracay, Honeymoon Guesthouse Bali, Bamboo House Ubud, Camaya BTurtle Beach Hotel Gili Air, Discovery Shores Boracay, Samloem Laguna Resort Cambodia, Hotel the Flag Japan and Pulo Cinta Indonesia to name a few and we would definitely love to work with you next!\r\n\r\nI cant wait to hear back from you, let me know what you think?\r\n\r\nKind regards,\r\n\r\nLee Scarratt', 10, NULL),
