('1542254082.9401', 'Contact Us', 'message', '【PRESS RELEASE】11/15ベトナム・ホーチミンに「ぼてぢゅう®グループ×山田宏巳シェフ」によるイタリアン「BASTA HiRo®︎」2号店オープン! 現地の水牛ミルクから作る自家製チーズなど素材にこだわる本格イタリアン\r\n\r\n日越関係ご担当者さま　各位\r\n\r\n日ごろよりお世話になっております。\r\n\r\nぼてぢゅうグループ×\"料理の鉄人\"山田宏巳シェフによる本格イタリアン「BASTA HiRo®︎」2号店が、11月15日にホーチミンにオープンいたします。詳細をお伝えしたく、ご連絡いたしました。\r\n\r\n◇詳細プレスリリース https://goo.gl/sbZXpF\r\n\r\nおかげさまで、2016年7月にオープンしたベトナム・サイゴンセンター高島屋内の1号店は常に満席の人気店となりました。この度オープンする2号店は、ベトナム最大の経済都市であるホーチミン中心部のロードサイドに位置し、オープンキッチンを配した店内で、独創的でクオリティーの高いイタリア料理を、カジュアルな雰囲気と価格で提供いたします。\r\n\r\n【新店舗】\r\nBASTA HiRo® Hai Ba Trung\r\n（ バスタ ヒロ ハイ バ チュン店）\r\n住所　　：　74B Hai Ba Trung st, Ben Nghe ward, District 1, Ho Chi Minh city, Viet Nam\r\n営業時間：　10：30 ～ 23：30（ラストオーダー22：45）\r\n定休日　：　なし\r\n客席数　：　189席\r\nプレオープン　　：2018年11月11日（日）\r\nグランドオープン：2018年11月15日（木）\r\n\r\n【既存店舗】\r\nBASTA HiRo® Vietnam Saigon Center Takashimaya\r\n（ バスタ ヒロ サイゴンセンター高島屋店）\r\n住所　　：　L3-26, Saigon Centre 65 Le Loi St., Dist.1, Ho Chi Minh City, Viet Nam\r\nTEL　　 ：　028-3821-8849\r\n営業時間：　10：30 ～ 22：30（ラストオーダー22：00）\r\nオープン：　2016年7月30日\r\n\r\n現地にお住まいの皆さま、ベトナムにご旅行を予定されている皆さまなど、たくさんのご来店をお待ちしております。\r\n\r\nーーーーーーーーーーーーーーーーーーーーーーーーーーーーーーー\r\n【 お問い合わせ先 】\r\n「ぼてぢゅう」PR担当：株式会社SUZU PR COMPANY　鈴江・小林\r\n〒150-0047　東京都渋谷区神山町17-3 テラス神山1F SPBS内\r\nTEL：080-6390-8284　MAIL：suzupr@suzu-pr.com　URL：http://suzu-pr.com\r\nーーーーーーーーーーーーーーーーーーーーーーーーーーーーーーー ', 11, NULL),
