('1544043031.1240', 'Contact Us - EN', 'message', 'Dear Matsunoi Team<br />\r\nI am planning to stay in Vietnam from 11 to 20 January for 9 nights. </p>\r\n<p>I read many comments about your hotel and I am interested in a stay as you seem have to quiet, clean and nice place. </p>\r\n<p>Anyway one thing is of my concern. I read 2 times in the reviews from other guests that the beds are very hard.<br />\r\nAs I am European i am used to soft beds. And as I want to stay for 9 nights this is an important criteria for me. Therefore I would like to know if your beds are really that hard?</p>\r\n<p>Thanks a lot for your honest answer. </p>\r\n<p>I also would like to know if you have safe inside the room and if you can keep luggage after check out as I have a late flight back at 8 pm. </p>\r\n<p>Thanks a lot for your help</p>\r\n<p>Best regards<br />\r\nRobin ', 10, NULL),
