('1545296328.3658', 'Contact Us', 'message', 'はじめまして。\r\n私はAGSリクルートメント部の岡山です。\r\n突然のご連絡となりますことご容赦くださいませ。\r\n\r\n弊社AGSはハノイを本社として、ホーチミン・ハノイに拠点を持ち、\r\n設立前のライセンスやビザ・労働許可書の取得、進出前の市場調査などのご支援から、\r\n設立後の会計・税務、労務・法務、人材紹介などのサービスをご提供しております。\r\n\r\n現在下記の人材の転職のサポートを行っております。\r\nもし下記のような人材の採用をご検討頂けるようでしたら、\r\n是非ご連絡を頂けますと幸いです。\r\n＿＿＿＿＿＿＿＿＿＿＿＿＿＿＿＿＿＿＿＿＿＿＿＿＿＿＿＿＿＿＿＿＿＿＿＿＿＿\r\n●候補者様　男性　（36）\r\n学歴　　　　：冨山国立大学　経済学部　経済学科　卒業\r\n職歴　　　　：ザ・　リッツカールトン大阪（11年）\r\n希望給与　　：2,000USD前後（相談可能）\r\n言語　　　　：英語（TOEIC680点）\r\n転職可能時期：オファーから1ヵ月後\r\n＊大学卒業後、11年間にわたりザ・　リッツカールトン大阪にて勤務されてきました。\r\n業務を通じ、語学の必要性をお感じになりフィリピンへの語学留学をされています。\r\nホテルでは主に宴会・サービス部にて社員からアルバイトまで3～100名のスタッフを\r\nまとめるキャプテンとしてご活躍されてきました。\r\nシフト制での勤務をされてきたため体力には自身ありとのことです。\r\n＿＿＿＿＿＿＿＿＿＿＿＿＿＿＿＿＿＿＿＿＿＿＿＿＿＿＿＿＿＿＿＿＿＿＿＿＿＿\r\n\r\n合わせて弊社サービスをご紹介させて頂きます。\r\n---------------------------------------------------------------------------------------\r\n人材サービスの内容及び規程（概要）\r\n\r\n・完全成功報酬制：人材が入社してから紹介手数料をいただきます。\r\n　それまでのご紹介、面接設定、アドバイス等の費用は不要です。\r\n\r\n・紹介手数料　　：年収（グロス月給×13ヶ月）×20%（税別）\r\n　＊入社後10日以内にご入金いただいております。\r\n\r\n・保証　　　　　：不幸にして人材が退職してしまった場合、最初の人材が\r\n入社してから3ヶ月間かつ3名まで代替人材をご紹介します。\r\n\r\n---------------------------------------------------------------------------------------\r\nその他ご要望がございましたら何なりとお申し付けくださいませ。\r\n\r\n突然の、勝手なご連絡となりますことご容赦くださいませ。\r\nどうぞ、よろしくお願いいたします。\r\n\r\n岡山', 11, NULL),
