('1550306748.0343', 'Contact Us - EN', 'message', 'Dear hotel/hostel,\r\n\r\nI\'m Zoltan Gali, a 33 years old  Hungarian/British photographer travelling with my German girlfriend Antonia in South East Asia until later next year. We are both enthusiastic about getting to know new countries-cultures-people and having the time of our life since last December.\r\nI\'d like to offer you my photography services to instantly improve your website/social media\'s general look. I have experience with commercial photography having done jobs in London before and professional equipment to take pictures of products, personnel, spaces! Photography is my passion and also profession and I\'d be me more than happy to help out in exchange for just a few nights of free accommodation which would be a great help for us extending our dream-like Asia trip! Appear and appeal the best way possible, results are guaranteed! \r\nHave a look at my previous work on Instagram and Facebook and decide if this would be something for you ;)\r\n\r\nBest regards,\r\n-- \r\nZoltan Gali, StrangerPhotography \r\n+447880975210\r\nFB https://www.facebook.com/StrangerPhotographyUK/\r\nIG https://www.instagram.com/strangerphotographyuk/\r\n', 11, NULL),
