('1584931451.4934', 'Contact Us', 'message', '\nご担当者様\r\n\r\nお世話になります。\r\nネットショップ電池屋の横森弘充（よこもりひろみつ）と申します。\r\n\r\n今回、新型コロナウイルスなどで発熱をしている人を\r\nカメラで確認できるサーモカメラ（熱画像）のご案内させていただきます。\r\n\r\n遊園地やイベント施設、病院、学校、官公庁施設様などから多くのお問い合わせを\r\n頂いている今注目の製品です。\r\n\r\n1分程度で読み終わりますので、ぜひご一読ください。\r\n\r\n--------- サーモカメラの詳細ページ --------\r\n\r\nhttps://knb.bz/link/3758/1\r\n\r\n--------------------------------------------\r\n\r\n\r\nイメージ掴んでいただきやすいように動画をアップしました。\r\n\r\n--------- サーモカメラの紹介動画 Youtube ------\r\n\r\nhttps://knb.bz/link/3759/1\r\n\r\n----------------------------------------------\r\n\r\nサーモカメラとは、映し出した画像の温度を測定するカメラです。\r\n多くの人が集まる場所や、会社のエントランスに設置し\r\n本人の自覚もない発熱までいち早く発見できます。\r\n\r\n【製品の特徴】\r\n・業界トップクラス 誤差±0.3℃の高精度\r\n・AIによる顔認証によりおでこ部分のみを測定。誤作動が少ない\r\n・16名前後の体表温を同時に想定可能\r\n・自動アラート機能付（画面を随時チェックする必要がない）\r\n・サーモカメラと可視カメラを1台で\r\n・導入／納品後、即日設置可能です\r\n\r\n『一般的なサーマルカメラ』\r\n・測定温度範囲　１～3℃\r\n※狩猟用の製品も多く、人体に使えないもの。\r\n　または測定範囲に誤差が大きく、平熱と区別のつかないものもある\r\n・納期／4月下旬のものが多い\r\n\r\n施設・イベント・学校・病院などでの体温測定サービスなどにお役立てください。\r\n大切な施設内でクラスター感染を起こしたくない方に大変お勧めしたい製品となっております。\r\n\r\n一般的な他社製品サーマルカメラは　人体測定用ですと\r\n温度帯域誤差が　1℃～2度程度で　200万円前後の製品です。\r\n但し、1℃以上あると、体表温 36．5℃の場合、37.5℃と判定してしまいます。\r\nまた、サーモカメラと可視カメラ（通常の画面）が別のものも多いです。\r\n\r\n今回ご案内の製品は　サーモカメラと可視カメラが1台に集約\r\n参考価格 275万（税抜）になります。\r\n\r\n●セット内容\r\nサーモカメラ×１（可視カメラ機能付き）\r\nサーマルカメラ用標準機×１（恒温器）\r\n専用三脚　×　2　（カメラ用、恒温器用）\r\n電源・マニュアル\r\n\r\nカメラは三脚以外に壁取り付けも可能です。\r\n\r\n見積書もすぐにお作りいたします。\r\n\r\n本製品は高精度のサーマルカメラ となっており、\r\nメリットは正確性と自動化と複数人数検知です。\r\n大切な施設内で感染を起こしたくない方に大変お勧めしたい製品となっております。\r\n\r\n--------- サーモカメラの詳細ページ --------\r\n\r\nhttps://knb.bz/link/3760/1\r\n\r\n--------------------------------------------\r\n\r\nデモ画面なども確認できますので、\r\nお気軽に仰ってください。\r\n\r\n遊園地での導入がすでに決まっております。\r\n\r\n以上ご検討いただければ幸いです。\r\n\r\n大変な時期ですが、\r\nお客様のサポートできればと思います。\r\n\r\nご不明な点がございましたらお気軽におっしゃってください。\r\nどうぞよろしくお願いします。\r\n\r\n営業担当\r\n横森 弘充（よこもり　ひろみつ）\r\n\n\n\n-----------------------------------------\n株式会社ヨコモリ電池屋コーポレーション\n\n企画部\n横森 弘充\nthermalcam@yokomori.info\nhttps://knb.bz/link/3692/13014900\n\n〒151-0073\n東京都渋谷区笹塚3-33-4\nTEL : 03-3378-0156\n-----------------------------------------\n\nご案内の停止をご希望の方は、下記URLをクリックして下さい。\nhttps://knb.bz/unsub/320/d3d3Lm1hdHN1bm9pLnZu\n\n\n', 13, NULL),
