(95, 28, '_mail_2', 'a:9:{s:6:\"active\";b:1;s:7:\"subject\";s:65:\"[Matsunoi Hotel] お問い合せ誠に有難う御座います。\";s:6:\"sender\";s:33:\"Matsunoi Hotel <info@matsunoi.vn>\";s:9:\"recipient\";s:15:\"[contact-email]\";s:4:\"body\";s:592:\"お問い合わせ・ご予約頂き有難うございます。\nこちらのメールは自動返信メールとなります。\n※ 正式なご予約は確定しておりません。\n弊社からのメールを今しばらくお待ちくださいませ。\nご不明点がございましたら、下記メールアドレスまでお問い合わせください。\nどうぞ宜しくお願い致します。\n\n松乃井ホテル・ホーチミン\nE-mail: info@matsunoi.vn\nOffice: 02838246068 / Fax: 02838246069 \n24/22 Đông Du, Bến Nghé Ward, District 1, Hồ Chí Minh City \nwww.matsunoi.vn\";s:18:\"additional_headers\";s:0:\"\";s:11:\"attachments\";s:0:\"\";s:8:\"use_html\";b:0;s:13:\"exclude_blank\";b:0;}'),
