(94, 28, '_mail', 'a:9:{s:6:\"active\";b:1;s:7:\"subject\";s:20:\"Matsunoi- Contact Us\";s:6:\"sender\";s:47:\"[family-name] [first-name]<noreply@matsunoi.vn>\";s:9:\"recipient\";s:16:\"info@matsunoi.vn\";s:4:\"body\";s:382:\"お名前 \n性 (ローマ字表記): [family-name] \n名 (ローマ字表記): [first-name]\n会社名 : [company-name]\nメール : [contact-email]\nお電話番号 : [phone2]\nチェックイン : [date_from]\nチェックアウト : [date_to]\n客室タイプ : [select-room]\n部屋数 : [room-number]\n宿泊人数 : [guest-number]\nVAT invoice : [vat]\nお問い合わせ内容\n[message]\";s:18:\"additional_headers\";s:53:\"Cc:ryoko.tozawa@sea-gulls.com,huutientt@sea-gulls.com\";s:11:\"attachments\";s:0:\"\";s:8:\"use_html\";b:0;s:13:\"exclude_blank\";b:0;}'),
(93, 28, '_form', '<style> .form-control::placeholder{ color:#aaa; }</style>\n<table class=\"table-contact-us\">\n    <tbody>\n        <tr>\n            <th>お名前 <span>※</span></th>\n            <td>\n               <div class=\"row\">\n                         <div class=\"col-xs-6 col-sm-6\">性 (ローマ字表記)<span style=\"color:#be0008; font-size:13px;\">※</span>\n                              [text* family-name class:form-control]\n                         </div>\n                         <div class=\"col-xs-6 col-sm-6\">名 (ローマ字表記)<span style=\"color:#be0008; font-size:13px;\">※</span>\n                              [text* first-name class:form-control]\n                         </div>\n                 </div>\n             </td>\n        </tr>\n        <tr>\n            <th>会社名 <span>※</span></th>\n            <td>[text* company-name class:form-control ]</td>\n        </tr>\n         <tr>\n            <th>お電話番号 <span>※</span></th>\n            <td>[text* phone2 class:form-control]\n                   [honeypot phone class:form-control]\n            </td>\n        </tr>\n        <tr>\n            <th>メール <span>※</span></th>\n            <td>[email* contact-email class:form-control ]</td>\n        </tr>\n       \n<tr>\n           <th>\n\n                 <div class=\"row\">\n                         <div class=\"col-xs-12 col-sm-4\">\n                              チェックイン<br/>[text date_from class:form-control]\n                         </div>\n                         <div class=\"col-xs-12 col-sm-4\">\n                              チェックアウト<br/>  [text date_to class:form-control]\n                         </div>\n                         <div class=\"col-xs-12 col-sm-4\">\n                              客室タイプ<br/>[select select-room include_blank \"スタンダード\" \"スーペリア\" \"デラックス\" \"ツイン\"] \n                         </div>\n                       \n                 </div>\n\n           </th>\n        </tr>\n       <tr>\n          <th>\n                  <div class=\"row\">\n                         <div class=\"col-xs-12 col-sm-3\">\n                              部屋数<br/>[select room-number include_blank \"1\" \"2\" \"3\" \"4\" \"5\" \"6\" \"7\" \"8\" \"9\" ]\n                         </div>\n                         <div class=\"col-xs-12 col-sm-3\">\n                             宿泊人数 <br/>[select guest-number include_blank \"1\" \"2\" \"3\" \"4\" \"5\" \"6\" \"7\" \"8\" \"9\" ]\n                         </div>\n                          <div class=\"col-xs-12 col-sm-3\">\n                             VAT invoice<br/>[select vat include_blank \"有り\" \"無し\"]\n                         </div>\n                             <!--    <div class=\"col-xs-12 col-sm-3\">\n                             朝食 <br/>[select breakfast include_blank \"有り\" \"無し\"]\n                         </div> -->\n                 </div>\n       </th>\n    </tr>\n\n<td>\n  </th>\n\n\n <td>\n         \n        <tr>\n            <th>お問い合わせ内容</th>\n            <td>[textarea message x5 class:form-control placeholder \"空港送迎ご希望の方は日付フライト番号人数を記載下さい\" ]</td>\n        </tr>\n        <tr>\n    \n            <td colspan=\"2\">[submit \"送信する\"]</td>\n        </tr>\n    </tbody>\n</table>'),
