(33816, 1728, 'wpsm_accordion_data', 's:11275:\"a:24:{i:0;a:4:{s:15:\"accordion_title\";s:57:\"ホテル滞在中、急に体調が悪くなったら？\";s:20:\"accordion_title_icon\";s:9:\"fa-laptop\";s:18:\"enable_single_icon\";s:2:\"no\";s:14:\"accordion_desc\";s:417:\"24時間体制で日本語のできるスタッフがホテルに常勤し、お客様のサポートを行っております。お客様より体調不良のご連絡があれば、症状や状況などをお伺いした上でそれらに応じた最寄りの病院をご紹介し、手配いたします。\r\n＊体温計・水枕・日本の薬（胃腸薬・風邪薬・正露丸）を常備しております。\r\n\";}i:1;a:4:{s:15:\"accordion_title\";s:97:\"チェックインは、3:00 pmからですが、それより前にホテルに到着したら？\";s:20:\"accordion_title_icon\";s:9:\"fa-laptop\";s:18:\"enable_single_icon\";s:2:\"no\";s:14:\"accordion_desc\";s:367:\"受付でお荷物をお預かりすることは可能です。ただしホテルご到着時にお部屋の確約が必要な場合は、アーリーチェックインの追加料金をお支払いいただくことになります。\r\n当日の9:00am前のご利用100％、9:00amからのご利用50％、12:00amからのご利用は30%となっております。\r\n\";}i:2;a:4:{s:15:\"accordion_title\";s:84:\"チェックアウト時間後にお部屋を利用することはできますか？\";s:20:\"accordion_title_icon\";s:9:\"fa-laptop\";s:18:\"enable_single_icon\";s:2:\"no\";s:14:\"accordion_desc\";s:326:\"お部屋に空きがある場合は、承ることができます。(有料)\r\n・15:00 p.m.までのレイトチェックアウト：1泊分の25%チャージ\r\n・18:00 p.m.までのレイトチェックアウト：1泊分の50%チャージ\r\n・18:00 p.m.以降のレイトチェックアウト：1泊分の100%チャージ\r\n\";}i:3;a:4:{s:15:\"accordion_title\";s:51:\"電子機器はそのまま利用できますか？\";s:20:\"accordion_title_icon\";s:9:\"fa-laptop\";s:18:\"enable_single_icon\";s:3:\"yes\";s:14:\"accordion_desc\";s:483:\"ご利用いただけます。コンセントの型は日本と同じA型ですがベトナムの電圧はほとんどが220Vですのでお気をつけてご使用くださいませ。日本の電気製品でも、100～240V対応の物であれば変圧器なしで使用できます。念のため使用予定の電気製品の取り扱い説明書をご確認ください。またコンセントプラグの差し込み口の付近に小さい文字で記載がございます。\";}i:4;a:4:{s:15:\"accordion_title\";s:81:\"レストランも禁煙ですか？ロビーに喫煙場所はありますか？\";s:20:\"accordion_title_icon\";s:9:\"fa-laptop\";s:18:\"enable_single_icon\";s:2:\"no\";s:14:\"accordion_desc\";s:194:\"指定の場所以外は全て禁煙でございます。　\r\n灰皿が設置された場所（２階・４階のエレベーター前、ロビー出口）のみ喫煙可能でございます。\";}i:5;a:4:{s:15:\"accordion_title\";s:87:\"深夜のチェックイン、又は早朝のチェックアウトはできますか？\";s:20:\"accordion_title_icon\";s:9:\"fa-laptop\";s:18:\"enable_single_icon\";s:2:\"no\";s:14:\"accordion_desc\";s:231:\"可能でございます。受付は２４時間対応しております。到着・出発予定時間がわかる場合は、事前にご連絡いただけますとチェックイン・チェックアウトがスムーズです。\";}i:6;a:4:{s:15:\"accordion_title\";s:69:\"チェックアウト後、荷物を預かってもらえますか？\";s:20:\"accordion_title_icon\";s:9:\"fa-laptop\";s:18:\"enable_single_icon\";s:2:\"no\";s:14:\"accordion_desc\";s:144:\"A.	お預かりいたします。大変恐れ入りますが、貴重品はご自身で管理いただきますようお願いいたします。\";}i:7;a:4:{s:15:\"accordion_title\";s:105:\"チェックイン前に配送サービスで荷物を送った場合、預かってもらえますか？\";s:20:\"accordion_title_icon\";s:9:\"fa-laptop\";s:18:\"enable_single_icon\";s:2:\"no\";s:14:\"accordion_desc\";s:245:\"発払いのお荷物のみお預かりいたします。事前にメールにて、お客様とお荷物*の情報をお知らせください。（*配送予定日、配送会社、お荷物の内容、お荷物の３辺のサイズ、個数）\";}i:8;a:4:{s:15:\"accordion_title\";s:96:\"滞在中、冷凍庫・冷蔵庫で保管が必要な荷物を預かってもらえますか？\";s:20:\"accordion_title_icon\";s:9:\"fa-laptop\";s:18:\"enable_single_icon\";s:2:\"no\";s:14:\"accordion_desc\";s:239:\"事前にメールにて、お客様とお荷物*の情報をお知らせください。（*お預かり期間、お荷物の内容、お荷物の３辺のサイズ、個数）サイズの確認が出来次第、ご回答いたします。\";}i:9;a:4:{s:15:\"accordion_title\";s:69:\"チェックアウト後、シャワーの利用はできますか？\";s:20:\"accordion_title_icon\";s:9:\"fa-laptop\";s:18:\"enable_single_icon\";s:2:\"no\";s:14:\"accordion_desc\";s:141:\"空室状況によりますが、有料でご利用頂くことができます。予約時または受付にお問い合わせください。\";}i:10;a:4:{s:15:\"accordion_title\";s:39:\"両替サービスはありますか？\";s:20:\"accordion_title_icon\";s:9:\"fa-laptop\";s:18:\"enable_single_icon\";s:2:\"no\";s:14:\"accordion_desc\";s:147:\"大変申し訳ございませんが、おこなっておりません。最寄り（徒歩５分ほど）の両替所をご紹介いたします。\";}i:11;a:4:{s:15:\"accordion_title\";s:45:\"コインランドリーはありますか？\";s:20:\"accordion_title_icon\";s:9:\"fa-laptop\";s:18:\"enable_single_icon\";s:2:\"no\";s:14:\"accordion_desc\";s:141:\"あいにくホテル館内にはございませんが、ホテルのランドリーサービス（有料）をご利用いただけます。\";}i:12;a:4:{s:15:\"accordion_title\";s:33:\"アイロンはありますか？\";s:20:\"accordion_title_icon\";s:9:\"fa-laptop\";s:18:\"enable_single_icon\";s:2:\"no\";s:14:\"accordion_desc\";s:186:\"貸出用のアイロン・アイロン台がございます。１回３０分ほど無料で貸し出しいたします。ご希望の際は受付へお申し付けくださいませ。\";}i:13;a:4:{s:15:\"accordion_title\";s:45:\"客室でのインターネット環境は？\";s:20:\"accordion_title_icon\";s:9:\"fa-laptop\";s:18:\"enable_single_icon\";s:2:\"no\";s:14:\"accordion_desc\";s:117:\"全客室にて、高速インターネット接続システム（無線）を無料でご使用いただけます。\";}i:14;a:4:{s:15:\"accordion_title\";s:39:\"朝食は、どんな内容ですか？\";s:20:\"accordion_title_icon\";s:9:\"fa-laptop\";s:18:\"enable_single_icon\";s:2:\"no\";s:14:\"accordion_desc\";s:105:\"ブッフェスタイルで提供致しております。和食メインでご用意しております。\";}i:15;a:4:{s:15:\"accordion_title\";s:45:\"朝食なしのプランはありますか？\";s:20:\"accordion_title_icon\";s:9:\"fa-laptop\";s:18:\"enable_single_icon\";s:2:\"no\";s:14:\"accordion_desc\";s:152:\"ございます。チェックイン後、朝食つきプランに変更も可能です。追加料金はお一人さま５ドル/日となります。 \";}i:16;a:4:{s:15:\"accordion_title\";s:66:\"宿泊していない方の朝食利用は可能でしょうか？\";s:20:\"accordion_title_icon\";s:9:\"fa-laptop\";s:18:\"enable_single_icon\";s:2:\"no\";s:14:\"accordion_desc\";s:132:\"はい、可能でございます。受付でお申し付けください。追加料金はお一人さま５ドルとなります。\";}i:17;a:4:{s:15:\"accordion_title\";s:63:\"空港～ホテル間の送迎サービスはありますか？\";s:20:\"accordion_title_icon\";s:9:\"fa-laptop\";s:18:\"enable_single_icon\";s:2:\"no\";s:14:\"accordion_desc\";s:222:\"有料にてご利用いただくことができます。送迎サービスをご利用の際は、指定の場所でお客様のお名前を記載したプラカードを持ってスタッフがお待ちいたします。\";}i:18;a:4:{s:15:\"accordion_title\";s:51:\"コンビニエンスストアはありますか？\";s:20:\"accordion_title_icon\";s:9:\"fa-laptop\";s:18:\"enable_single_icon\";s:2:\"no\";s:14:\"accordion_desc\";s:180:\"ホテル館内にはございませんが、徒歩圏内にございます。スタッフがご案内させて頂きますのでご遠慮なくお申し付けくださいませ。\";}i:19;a:4:{s:15:\"accordion_title\";s:30:\"駐車場はありますか？\";s:20:\"accordion_title_icon\";s:9:\"fa-laptop\";s:18:\"enable_single_icon\";s:2:\"no\";s:14:\"accordion_desc\";s:102:\"バイクのみございます。満車の場合は、近隣の駐輪場をご案内いたします。\";}i:20;a:4:{s:15:\"accordion_title\";s:42:\"オンライン決済はできますか？\";s:20:\"accordion_title_icon\";s:9:\"fa-laptop\";s:18:\"enable_single_icon\";s:2:\"no\";s:14:\"accordion_desc\";s:216:\"恐れ入りますが、現在のところオンラインでの決済サービスはございません。チェックイン前の銀行お振込みをご希望の際は、ご予約時にお申し付けください。\";}i:21;a:4:{s:15:\"accordion_title\";s:42:\"精算はいつすればいいですか？\";s:20:\"accordion_title_icon\";s:9:\"fa-laptop\";s:18:\"enable_single_icon\";s:2:\"no\";s:14:\"accordion_desc\";s:475:\"通常チェックイン時のご精算をお願いしております。長期滞在者さま（１ヶ月以上の方）はチェックイン時に全額でなく、１０日ごと・月ごとなどの数回に分けて事前支払いをお願しております。\r\n\r\n法人契約の方のみ、チェックアウト時、チェックアウト後の銀行振込も可能でございます。長期滞在者さまには月初に前月分を請求させていただきます。\";}i:22;a:4:{s:15:\"accordion_title\";s:72:\"パスポートを紛失した場合、どうしたらいいですか？\";s:20:\"accordion_title_icon\";s:9:\"fa-laptop\";s:18:\"enable_single_icon\";s:2:\"no\";s:14:\"accordion_desc\";s:813:\"必要書類をそろえて、在ホーチミン日本国総領事館で「帰国のための渡航書」または「紛失・再発行」の手続きを行う必要があります。まずは在ホーチミン日本国総領事館+84-28-3933-3510にご本人さまから連絡して、総領事館の方にご相談ください。\r\n本人以外の問い合わせの場合は、個人情報のためスムーズに手続きが行えません。\r\n\r\n必要書類には警察で発行する紛失証明書や戸籍謄本、航空券の控え、証明写真など、ご本人の状況や手続きの種類によりご準備する書類が若干異なります。警察で発行する紛失証明書もご本人が行く必要がございます。サポートが必要な方は受付にお申し付けください。\r\n\";}i:23;a:4:{s:15:\"accordion_title\";s:78:\"法人契約について知りたい場合はどうしたらいいですか？\";s:20:\"accordion_title_icon\";s:9:\"fa-laptop\";s:18:\"enable_single_icon\";s:2:\"no\";s:14:\"accordion_desc\";s:367:\"HPの予約・問い合わせページに入力・送信していただくか、info@matsunoi.comまでお問合わせください。法人契約の内容をご案内いたします。ご契約の場合は、契約書へ署名・捺印しスキャンデータをお送りいただき、チェックイン時に原本をお持ちくださいかご郵送ください。\";}}\";'),
