(28, 1, '2017-06-28 03:14:28', '2017-06-28 03:14:28', '<style> .form-control::placeholder{ color:#aaa; }</style>\r\n<table class=\"table-contact-us\">\r\n    <tbody>\r\n        <tr>\r\n            <th>お名前 <span>※</span></th>\r\n            <td>\r\n               <div class=\"row\">\r\n                         <div class=\"col-xs-6 col-sm-6\">性 (ローマ字表記)<span style=\"color:#be0008; font-size:13px;\">※</span>\r\n                              [text* family-name class:form-control]\r\n                         </div>\r\n                         <div class=\"col-xs-6 col-sm-6\">名 (ローマ字表記)<span style=\"color:#be0008; font-size:13px;\">※</span>\r\n                              [text* first-name class:form-control]\r\n                         </div>\r\n                 </div>\r\n             </td>\r\n        </tr>\r\n        <tr>\r\n            <th>会社名 <span>※</span></th>\r\n            <td>[text* company-name class:form-control ]</td>\r\n        </tr>\r\n         <tr>\r\n            <th>お電話番号 <span>※</span></th>\r\n            <td>[text* phone2 class:form-control]\r\n                   [honeypot phone class:form-control]\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <th>メール <span>※</span></th>\r\n            <td>[email* contact-email class:form-control ]</td>\r\n        </tr>\r\n       \r\n<tr>\r\n           <th>\r\n\r\n                 <div class=\"row\">\r\n                         <div class=\"col-xs-12 col-sm-4\">\r\n                              チェックイン<br/>[text date_from class:form-control]\r\n                         </div>\r\n                         <div class=\"col-xs-12 col-sm-4\">\r\n                              チェックアウト<br/>  [text date_to class:form-control]\r\n                         </div>\r\n                         <div class=\"col-xs-12 col-sm-4\">\r\n                              客室タイプ<br/>[select select-room include_blank \"スタンダード\" \"スーペリア\" \"デラックス\" \"ツイン\"] \r\n                         </div>\r\n                       \r\n                 </div>\r\n\r\n           </th>\r\n        </tr>\r\n       <tr>\r\n          <th>\r\n                  <div class=\"row\">\r\n                         <div class=\"col-xs-12 col-sm-3\">\r\n                              部屋数<br/>[select room-number include_blank \"1\" \"2\" \"3\" \"4\" \"5\" \"6\" \"7\" \"8\" \"9\" ]\r\n                         </div>\r\n                         <div class=\"col-xs-12 col-sm-3\">\r\n                             宿泊人数 <br/>[select guest-number include_blank \"1\" \"2\" \"3\" \"4\" \"5\" \"6\" \"7\" \"8\" \"9\" ]\r\n                         </div>\r\n                          <div class=\"col-xs-12 col-sm-3\">\r\n                             VAT invoice<br/>[select vat include_blank \"有り\" \"無し\"]\r\n                         </div>\r\n                             <!--    <div class=\"col-xs-12 col-sm-3\">\r\n                             朝食 <br/>[select breakfast include_blank \"有り\" \"無し\"]\r\n                         </div> -->\r\n                 </div>\r\n       </th>\r\n    </tr>\r\n\r\n<td>\r\n  </th>\r\n\r\n\r\n <td>\r\n         \r\n        <tr>\r\n            <th>お問い合わせ内容</th>\r\n            <td>[textarea message x5 class:form-control placeholder \"空港送迎ご希望の方は日付フライト番号人数を記載下さい\" ]</td>\r\n        </tr>\r\n        <tr>\r\n    \r\n            <td colspan=\"2\">[submit \"送信する\"]</td>\r\n        </tr>\r\n    </tbody>\r\n</table>\n1\nMatsunoi- Contact Us\n[family-name] [first-name]<noreply@matsunoi.vn>\ninfo@matsunoi.vn\nお名前 \r\n性 (ローマ字表記): [family-name] \r\n名 (ローマ字表記): [first-name]\r\n会社名 : [company-name]\r\nメール : [contact-email]\r\nお電話番号 : [phone2]\r\nチェックイン : [date_from]\r\nチェックアウト : [date_to]\r\n客室タイプ : [select-room]\r\n部屋数 : [room-number]\r\n宿泊人数 : [guest-number]\r\nVAT invoice : [vat]\r\nお問い合わせ内容\r\n[message]\nCc:ryoko.tozawa@sea-gulls.com,huutientt@sea-gulls.com\n\n\n\n1\n[Matsunoi Hotel] お問い合せ誠に有難う御座います。\nMatsunoi Hotel <info@matsunoi.vn>\n[contact-email]\nお問い合わせ・ご予約頂き有難うございます。\r\nこちらのメールは自動返信メールとなります。\r\n※ 正式なご予約は確定しておりません。\r\n弊社からのメールを今しばらくお待ちくださいませ。\r\nご不明点がございましたら、下記メールアドレスまでお問い合わせください。\r\nどうぞ宜しくお願い致します。\r\n\r\n松乃井ホテル・ホーチミン\r\nE-mail: info@matsunoi.vn\r\nOffice: 02838246068 / Fax: 02838246069 \r\n24/22 Đông Du, Bến Nghé Ward, District 1, Hồ Chí Minh City \r\nwww.matsunoi.vn\n\n\n\n\nThank you for your message. It has been sent.\nThere was an error trying to send your message. Please try again later.\nOne or more fields have an error. Please check and try again.\nThere was an error trying to send your message. Please try again later.\nYou must accept the terms and conditions before sending your message.\nThe field is required.\nThe field is too long.\nThe field is too short.\nPlease fill out the form on the previous page.\nThe date format is incorrect.\nThe date is before the earliest one allowed.\nThe date is after the latest one allowed.\nThere was an unknown error uploading the file.\nYou are not allowed to upload files of this type.\nThe file is too big.\nThere was an error uploading the file.\nThe number format is invalid.\nThe number is smaller than the minimum allowed.\nThe number is larger than the maximum allowed.\nThe answer to the quiz is incorrect.\nThe e-mail address entered is invalid.\nThe URL is invalid.\nThe telephone number is invalid.', 'Contact Us', '', 'publish', 'closed', 'closed', '', 'untitled', '', '', '2020-11-02 01:13:29', '2020-11-02 01:13:29', '', 0, 'https://www.aunasset.com//?post_type=wpcf7_contact_form&#038;p=28', 0, 'wpcf7_contact_form', '', 0),
