(1293, 1, '2018-03-28 08:05:37', '2018-03-28 08:05:37', '<style> .form-control::placeholder{ color:#aaa; }</style>\r\n<table class=\"table-contact-us\">\r\n    <tbody>\r\n        <tr>\r\n            <th>Name <span>*</span></th>\r\n            <td>[text* your-name class:form-control]</td>\r\n        </tr>\r\n        <tr>\r\n            <th>Company name <span>*</span></th>\r\n            <td>[text* company-name class:form-control ]</td>\r\n        </tr>\r\n         <tr>\r\n            <th>Phone number <span>*</span></th>\r\n            <td>[text* phone2 class:form-control]\r\n                   [honeypot phone]\r\n</td>\r\n        </tr>\r\n        <tr>\r\n            <th>Mail address <span>*</span></th>\r\n            <td>[email* contact-email class:form-control ]</td>\r\n        </tr>\r\n\r\n\r\n\r\n<tr>\r\n           <th>\r\n                 <div class=\"row\">\r\n                         <div class=\"col-xs-12 col-sm-4\">\r\n                              Check in <br/>[text date_from class:form-control]\r\n                         </div>\r\n                         <div class=\"col-xs-12 col-sm-4\">\r\n                              Check out <br/>  [text date_to class:form-control]\r\n                         </div>\r\n                         <div class=\"col-xs-12 col-sm-4\">\r\n                              Room type <br/>[select select-room include_blank \"Standard\" \"Superior\" \"Deluxe\" \"Twin\"] \r\n                         </div>\r\n                 </div>\r\n           </th>\r\n        </tr>\r\n       <tr>\r\n          <th>\r\n                  <div class=\"row\">\r\n                         <div class=\"col-xs-12 col-sm-3\">\r\n                              Rooms <br/>[select room-number include_blank \"1\" \"2\" \"3\" \"4\" \"5\" \"6\" \"7\" \"8\" \"9\" ]\r\n                         </div>\r\n                         <div class=\"col-xs-12 col-sm-3\">\r\n                             People <br/>[select guest-number include_blank \"1\" \"2\" \"3\" \"4\" \"5\" \"6\" \"7\" \"8\" \"9\" ]\r\n                         </div>\r\n                          <div class=\"col-xs-12 col-sm-3\">\r\n                             VAT invoice<br/>[select vat include_blank \"Yes\" \"No\"]\r\n                         </div> \r\n                       <!--  <div class=\"col-xs-12 col-sm-3\">\r\n                             Breakfast<br/>[select breakfast include_blank \"Yes\" \"No\"]\r\n                         </div> -->\r\n \r\n                 \r\n\r\n       \r\n\r\n <td>\r\n  </th>\r\n\r\n       \r\n        <tr>\r\n            <th>Content</th>\r\n            <td>[textarea message x5 class:form-control placeholder \"If you require the airport transfer service, please kindly indicate your flight information\"]</td>\r\n        </tr>\r\n        <tr>\r\n    \r\n            <td colspan=\"2\">[submit \"Send\"]</td>\r\n        </tr>\r\n    </tbody>\r\n</table>\n1\nMatsunoi- Contact Us\n[your-name] <noreply@matsunoi.vn>\ninfo@matsunoi.vn\nCompany Name : [company-name]\r\nYour Name : [your-name]\r\nEmail Address : [contact-email]\r\nPhone : [phone2]\r\nCheck in : [date_from]\r\nCheck out  : [date_to]\r\nRoom type : [select-room]\r\nRooms : [room-number]\r\nPeople : [guest-number]\r\nVAT invoice : [vat]\r\nDetail\r\n[message]\nCc:ryoko.tozawa@sea-gulls.com,huutientt@sea-gulls.com\nBCC:anh.tran@auncon.co.jp\n\n\n\n1\n[Matsunoi Hotel] Thank you for contacting us\nMatsunoi Hotel <info@matsunoi.vn>\n[contact-email]\nThank you for your reservation enquiry. \r\nThis is an automatically generated email. \r\n※ Please note this booking is not confirmed yet.\r\nWe would confirm your reservation enquiry and reply to you as soon as possible.\r\nPlease kindly wait for our confirmation.\r\nIf you have any questions, please feel free to contact us as below address.\r\nThank you so much.\r\n\r\nMatsunoi Hotel Ho Chi Minh\r\nE-mail: info@matsunoi.vn\r\nTelephone: 02838246068 / Fax: 02838246069 \r\n24/22 Đông Du, Bến Nghé Ward, District 1, Hồ Chí Minh City \r\nwww.matsunoi.vn　\n\n\n\n\nThank you for your message. It has been sent.\nThere was an error trying to send your message. Please try again later.\nOne or more fields have an error. Please check and try again.\nThere was an error trying to send your message. Please try again later.\nYou must accept the terms and conditions before sending your message.\nThe field is required.\nThe field is too long.\nThe field is too short.\nPlease fill out the form on the previous page.\nThe date format is incorrect.\nThe date is before the earliest one allowed.\nThe date is after the latest one allowed.\nThere was an unknown error uploading the file.\nYou are not allowed to upload files of this type.\nThe file is too big.\nThere was an error uploading the file.\nThe number format is invalid.\nThe number is smaller than the minimum allowed.\nThe number is larger than the maximum allowed.\nThe answer to the quiz is incorrect.\nThe e-mail address entered is invalid.\nThe URL is invalid.\nThe telephone number is invalid.', 'Contact Us - EN', '', 'publish', 'closed', 'closed', '', 'contact-us_copy', '', '', '2020-11-02 01:11:13', '2020-11-02 01:11:13', '', 0, 'http://matsunoi.vn/?post_type=wpcf7_contact_form&#038;p=1293', 0, 'wpcf7_contact_form', '', 0),
