(1294, 1, '2018-03-28 08:06:03', '2018-03-28 08:06:03', '<style> .form-control::placeholder{ color:#aaa; }</style>\r\n<table class=\"table-contact-us\">\r\n    <tbody>\r\n        <tr>\r\n            <th>Họ và tên <span>*</span></th>\r\n            <td>[text* your-name class:form-control]</td>\r\n        </tr>\r\n        <tr>\r\n            <th>Tên công ty <span>*</span></th>\r\n            <td>[text* company-name class:form-control ]</td>\r\n        </tr>\r\n         <tr>\r\n            <th>Số điện thoại <span>*</span></th>\r\n            <td>[text* phone2 class:form-control]\r\n[honeypot phone]\r\n</td>\r\n        </tr>\r\n        <tr>\r\n            <th>Địa chỉ email <span>*</span></th>\r\n            <td>[email* contact-email class:form-control ]</td>\r\n        </tr>\r\n       \r\n\r\n<tr>\r\n           <th>\r\n                 <div class=\"row\">\r\n                         <div class=\"col-xs-12 col-sm-4\">\r\n                              Check in <br/>[text date_from class:form-control]\r\n                         </div>\r\n                         <div class=\"col-xs-12 col-sm-4\">\r\n                              Check out <br/>  [text date_to class:form-control]\r\n                         </div>\r\n                         <div class=\"col-xs-12 col-sm-4\">\r\n                              Loại Phòng <br/>[select select-room include_blank \"Phòng Standard\" \"Phòng Superior\" \"Phòng Deluxe\" \"Phòng Twin\"] \r\n                         </div>\r\n                 </div>\r\n           </th>\r\n        </tr>\r\n       <tr>\r\n          <th>\r\n                  <div class=\"row\">\r\n                         <div class=\"col-xs-12 col-sm-3\">\r\n                              Số lượng phòng<br/>[select room-number include_blank \"1\" \"2\" \"3\" \"4\" \"5\" \"6\" \"7\" \"8\" \"9\" ]\r\n                         </div>\r\n                         <div class=\"col-xs-12 col-sm-3\">\r\n                             Số lượng khách<br/>[select guest-number include_blank \"1\" \"2\" \"3\" \"4\" \"5\" \"6\" \"7\" \"8\" \"9\" ]\r\n                         </div>\r\n                          <div class=\"col-xs-12 col-sm-3\">\r\n                             Hóa Đơn VAT<br/>[select vat include_blank \"Có\" \"Không\"]\r\n                         </div>\r\n                              <!--   <div class=\"col-xs-12 col-sm-3\">\r\n                             Bữa sáng<br/>[select breakfast include_blank \"Có\" \"Không\"]\r\n                         </div> -->\r\n                 </div>\r\n       </th>\r\n    </tr>\r\n\r\n<td>\r\n  </th>\r\n\r\n         <tr>\r\n            <th>Nội dung</th>\r\n            <td>[textarea message x5 class:form-control placeholder \"Nếu quý khách muốn sử dụng dịch vụ đón tại sân bay, xin vui lòng điền thông tin chuyến bay\"]</td>\r\n        </tr>\r\n        <tr>\r\n    \r\n            <td colspan=\"2\">[submit \"Gửi\"]</td>\r\n        </tr>\r\n    </tbody>\r\n</table>\n1\nMatsunoi- Contact Us\n[your-name] <noreply@matsunoi.vn>\ninfo@matsunoi.vn\nTên công ty  : [company-name]\r\nHọ và tên : [your-name]\r\nĐịa chỉ email : [contact-email]\r\nSố điện thoại : [phone2]\r\nCheck in : [date_from]\r\nCheck out  : [date_to]\r\nLoại Phòng : [select-room]\r\nSố lượng phòng : [room-number]\r\nSố lượng khách : [guest-number]\r\nHóa Đơn VAT: [vat]\r\nBữa sáng : [breakfast]\r\nNội dung\r\n[message]\nCc:ryoko.tozawa@sea-gulls.com,huutientt@sea-gulls.com\n\n\n\n1\n[Matsunoi Hotel] Cảm ơn bạn vì đã liên lạc với chúng tôi.\nMatsunoi Hotel <info@matsunoi.vn>\n[contact-email]\nCảm ơn bạn đã gửi yêu cầu.\r\nĐây là email tự động.\r\n※ Xin lưu ý rằng yêu cầu đặt phòng này chưa được xác nhận.\r\nChúng tôi sẽ xác nhận yêu cầu đặt phòng của bạn và trả lời sớm nhất có thể.\r\nXin vui lòng chờ xác nhận của chúng tôi.\r\nNếu bạn có bất kỳ câu hỏi nào, vui lòng liên hệ với chúng tôi theo địa chỉ dưới đây.\r\nXin cám ơn.\r\n\r\nKhách sạn Matsunoi Hồ Chí Minh\r\nE-mail: info@matsunoi.vn\r\nĐiện thoại: 02838246068 / Fax: 02838246069 \r\n24/22 Đông Du, Phường Bến Nghé, Quận 1, Thành phố Hồ Chí Minh\r\nwww.matsunoi.vn　\n\n\n\n\nThank you for your message. It has been sent.\nThere was an error trying to send your message. Please try again later.\nOne or more fields have an error. Please check and try again.\nThere was an error trying to send your message. Please try again later.\nYou must accept the terms and conditions before sending your message.\nThe field is required.\nThe field is too long.\nThe field is too short.\nPlease fill out the form on the previous page.\nThe date format is incorrect.\nThe date is before the earliest one allowed.\nThe date is after the latest one allowed.\nThere was an unknown error uploading the file.\nYou are not allowed to upload files of this type.\nThe file is too big.\nThere was an error uploading the file.\nThe number format is invalid.\nThe number is smaller than the minimum allowed.\nThe number is larger than the maximum allowed.\nThe answer to the quiz is incorrect.\nThe e-mail address entered is invalid.\nThe URL is invalid.\nThe telephone number is invalid.', 'Contact Us - VN', '', 'publish', 'closed', 'closed', '', 'contact-us-en_copy', '', '', '2020-11-02 01:13:52', '2020-11-02 01:13:52', '', 0, 'http://matsunoi.vn/?post_type=wpcf7_contact_form&#038;p=1294', 0, 'wpcf7_contact_form', '', 0),
