INSERT INTO `content_lang` (`id`, `lang_id`, `content`) VALUES
(1, 1, '<ul class=\"clearfix\">\r\n	<li><span class=\"text\">チェックイン　<strong>15:00 </strong></span></li>\r\n	<li><span class=\"text\">チェックアウト　<strong>12:00 </strong></span></li>\r\n	<li><span class=\"text\">朝食時間（無料）<strong>6:00~9:30</strong></span></li>\r\n</ul>\r\n<span>　場所：レストラン会場９階</span><br />\r\n※早い出発の方には、おにぎりのご用意も可能（要事前予約）\r\n<ul class=\"clearfix\">\r\n	<li><span class=\"text\">日本語対応可能なスタッフが随時常駐。 </span></li>\r\n	<li><span class=\"text\">日本人街レタントン通り徒歩5分 </span></li>\r\n	<li><span class=\"text\">全室禁煙でございます。</span></li>\r\n</ul>\r\n<br />\r\n<span class=\"text\">　　</span>【テト休業のお知らせ】<br />\r\n2018年2月13日~19日はテト休日の為、<wbr />休業いたします。<br />\r\n2月20日のチェックインからお泊まりいただけます。'),
(1, 2, '<ul class=\"clearfix\">\r\n	<li><span class=\"text\">Check &ndash; in: <strong>15:00 </strong></span></li>\r\n	<li><span class=\"text\">Check &ndash; out: <strong>12:00 </strong></span></li>\r\n	<li><span class=\"text\">Breakfast (free) from <strong>6:00 to 9:30</strong> Location: restaurant in 9th floor </span></li>\r\n	<li><span class=\"text\">Staff capable of handling Japanese is always resident. </span></li>\r\n	<li><span class=\"text\">Japanese street is 5 minutes by walk from the hotel. </span></li>\r\n	<li><span class=\"text\">All rooms are non-smoking room </span></li>\r\n</ul>\r\n<br />\r\n【Tet Holiday】<br />\r\nhotel will be closed from Feb 13<sup>th</sup> to Feb 19<sup>th</sup><br />\r\n<span class=\"text\">We will resume operating on Feb 20th 2018. We wish you and family a New Year full of happiness, prosperity and good health.</span>'),
(1, 3, '<ul class=\"clearfix\">\r\n	<li><span class=\"text\">Giờ nhận ph&ograve;ng: <strong>15:00 </strong></span></li>\r\n	<li><span class=\"text\">Giờ trả ph&ograve;ng: <strong>12:00 </strong></span></li>\r\n	<li><span class=\"text\">Ăn s&aacute;ng (miễn ph&iacute;) từ <strong>6:00 đến 9:30</strong> tại nh&agrave; h&agrave;ng ở lầu 9 của kh&aacute;ch sạn </span></li>\r\n	<li><span class=\"text\">Lu&ocirc;n c&oacute; nh&acirc;n vi&ecirc;n biết tiếng Nhật t&uacute;c trực </span></li>\r\n	<li><span class=\"text\">Chỉ c&aacute;ch khu phố Nhật 5 ph&uacute;t đi bộ </span></li>\r\n	<li><span class=\"text\">Tất cả c&aacute;c ph&ograve;ng trong kh&aacute;ch sạn l&agrave; ph&ograve;ng KH&Ocirc;NG h&uacute;t thuốc </span></li>\r\n</ul>\r\n<br />\r\n<span class=\"text\">Ch&uacute;ng t&ocirc;i tr&acirc;n trọng th&ocirc;ng b&aacute;o lịch nghỉ Tết của kh&aacute;ch sạn ch&uacute;ng t&ocirc;i đến qu&yacute; kh&aacute;ch như sau: từ ng&agrave;y <strong>13/1/2018</strong> đến hết ng&agrave;y <strong>19/1/2018</strong>. Ch&uacute;ng t&ocirc;i sẽ hoạt động trở lại v&agrave;o ng&agrave;y <strong>20/1/2018</strong>. K&iacute;nh ch&uacute;c qu&yacute; kh&aacute;ch một năm mới với thật nhiều niềm vui, hạnh ph&uacute;c v&agrave; sức khỏe dồi d&agrave;o.</span>'),
(2, 1, '<ul class=\"list-inline clearfix\">\r\n	<li><span class=\"text\">レイトチェックアウト料金（１８：００時までのご利用）はお部屋代の５０％となります。それ以降を過ぎますと、１泊料金となります。 </span></li>\r\n	<li><span class=\"text\">上記料金にはサービス料5%,税10%は含まれておりません。 </span></li>\r\n	<li><span class=\"text\">曜日やイベント等により、料金が変更になる場合がございます。</span></li>\r\n	<li><span class=\"text\">添い寝のお子様（六歳まで）は無料です。ただし、アメニティグッズや枕は付きません。アメニティや枕、タオル等のご利用の場合は10ドルとなります。お子様の人数はリクエスト欄にご記入ください。 </span></li>\r\n	<li><span class=\"text\">キャンセルは予約日の48時間前（2日前）に、ご連絡お願い致します。これ以降を過ぎますと、一泊分のキャンセル料が発生します。 </span></li>\r\n</ul>'),
(2, 2, '<ul class=\"list-inline clearfix\">\r\n	<li><span class=\"text\">Late check &ndash; out fee is 50% of room charge (until 18:00). After that, it will be one night charge. </span></li>\r\n	<li><span class=\"text\">All prices are subject to 10% VAT and 5% service charge. </span></li>\r\n	<li><span class=\"text\">Depending on the day of the week or event, the price may be varied. </span></li>\r\n	<li><span class=\"text\">Children (under 6 years old) are free of charge. However, amenities and pillows are not included. For usage of amenities, pillows, towels, and so on, it cost 10 USD. Please fill in at the request box. </span></li>\r\n	<li><span class=\"text\">Cancellation must be made 48 hours (2 days) before the date of arrival. After this time, one night cancellation fee will be applied. </span></li>\r\n</ul>'),
(2, 3, '<ul class=\"list-inline clearfix\">\r\n	<li><span class=\"text\">Trả ph&ograve;ng trễ sẽ trả 50% tiền ph&ograve;ng (trước 18:00). Sau 18:00 sẽ t&iacute;nh một đ&ecirc;m tiền ph&ograve;ng. </span></li>\r\n	<li><span class=\"text\">Gi&aacute; ph&ograve;ng chưa bao gồm 10% VAT v&agrave; 5% ph&iacute; phục vụ </span></li>\r\n	<li><span class=\"text\">T&ugrave;y thuộc v&agrave;o thời điểm m&agrave; gi&aacute; ph&ograve;ng c&oacute; thể thay đổi </span></li>\r\n	<li><span class=\"text\">Trẻ em (dưới 6 tuổi) sẽ kh&ocirc;ng bị t&iacute;nh ph&iacute;. Tuy nhi&ecirc;n c&aacute;c trang bị trong ph&ograve;ng v&agrave; gối nằm sẽ kh&ocirc;ng được bao gồm. V&igrave; thế để sử dụng c&aacute;c vật tr&ecirc;n kh&aacute;ch sẽ phải trả th&ecirc;m 10 USD. Nếu c&oacute; trẻ em đi k&egrave;m, vui l&ograve;ng điền v&agrave;o &ocirc; y&ecirc;u cầu. </span></li>\r\n	<li><span class=\"text\">Y&ecirc;u cầu hủy ph&ograve;ng phải được gửi trước 48 tiếng (tức 2 ng&agrave;y) t&iacute;nh từ ng&agrave;y đến. Sau khoảng thời gian n&agrave;y, nếu kh&aacute;ch hủy ph&ograve;ng sẽ bị t&iacute;nh một đ&ecirc;m tiền ph&ograve;ng. </span></li>\r\n</ul>'),
(7, 1, '<p>到着出口（空港建物内）を出て、タクシー受付カウンターにて申し込む場合 TAXI表示のある受付カウンターに行き、受付係員に当ホテルの住所を提示いたします。その場で係員に料金を支払い、２枚のレシートを受け取ります。（白い紙がドライバー控え、２枚目のピンク色の紙がお客様の領収書となります）</p>\r\n\r\n<p>係員から１０番乗り場（出口を出て右側）へ進むよう、案内があります。レシート２枚を持ったまま、出口を出て指定された乗り場にお進みください。配車手配の係員が声をかけてきますので、レシートを渡し、係員と一緒に配車の車に向かいます。車に乗り、ピンク色の領収書を受け取ります。</p>\r\n\r\n<p style=\"color: #00a333;\">車内での追加料金はございません。</p>'),
(7, 2, '<p>Exit the arrival gate (within the airport building) and head for the taxi reception counter. The taxi counter is a place with the TAXI display. At the counter, please present the address of our hotel to staff. Pay the fee to the staff on the spot and receive 2 receipts. (White paper is driver&rsquo;s note, the second piece of pink color will be the customer&rsquo;s receipt)</p>\r\n\r\n<p>There is a guidance from the staff to go to No 10 gate (right hand side from exit gate). With 2 receipts, please proceed to the designated place. As staff at No 10 calls out, please pass the receipt and head for the car to be dispatched along with the staff. Take the car and you will receive the pink receipt.</p>\r\n\r\n<p style=\"color: #00a333;\">There is no additional charge in the car.</p>'),
(7, 3, NULL),
(8, 1, '<p>タクシー乗り場の場合. 到着出口を出て左へ向かいます。タクシー乗り場でお並びください。タクシー会社はたくさんございますが、白色の <span style=\"color: #00a333;\">&ldquo;Vinasun Taxi&rdquo; (電話番号 028 38 27 27 27) もしくは緑色の &ldquo;Mai Linh Taxi&rdquo; (電話番号 028 38 38 38 38).</span> のご利用をお勧めいたします。料金はメーター表示額と空港利用税１万ドンを、降車時にベトナムドンでお支払いください。</p>\r\n\r\n<p style=\"color: #ea0000;\">タクシー番号を覚えていると、お忘れものをしたときに連絡がつきます。.</p>'),
(8, 2, '<p>Leave the exit gate and head left. Please line up at the taxi stand. There are a lot of taxi companies, but we recommend using <span style=\"color: #00a333;\">&ldquo;Vinasun Taxi&rdquo; (Tel No 028 38 27 27 27) or &ldquo;Mai Linh Taxi&rdquo; (Tel No 028 38 38 38 38).</span> Please pay the meter display amount and airport use tax of 10.000 VND in Vietnam Dong when getting off.</p>\r\n\r\n<p style=\"color: #ea0000;\">Note: please remember taxi driver number in case of recontacting for lost and found.</p>\r\n\r\n<p>Because we located in a small alley from the street, in case you are lost please contact us via</p>\r\n\r\n<p style=\"color: #ea0000;\">Tel No 028 38246068.</p>'),
(8, 3, NULL),
(9, 1, '申し訳ございませんが、現在このホテルでは、ご希望の日程は満室となっております。 もう一度ご検索ください。'),
(9, 2, 'Sorry, currently there are no rooms available at this property for the dates you selected. Please try your search again'),
(9, 3, 'Xin lỗi qu&yacute; kh&aacute;ch, hiện tại ch&uacute;ng t&ocirc;i đ&atilde; hết ph&ograve;ng theo y&ecirc;u cầu của qu&yacute; kh&aacute;ch. Qu&yacute; kh&aacute;ch vui l&ograve;ng kiểm tra lại.'),
(10, 1, 'キャンセルは予約日の48時間前（2日前）に、ご連絡お願い致します。これ以降を過ぎますと、一泊分のキャンセル料が発生します。'),
(10, 2, 'Cancellation must be made 48 hours (2 days) before the date of arrival. After this time, one night cancellation fee will be applied.'),
(10, 3, 'Y&ecirc;u cầu hủy ph&ograve;ng phải được gửi trước 48 tiếng (tức 2 ng&agrave;y) t&iacute;nh từ ng&agrave;y đến. Sau khoảng thời gian n&agrave;y, nếu kh&aacute;ch hủy ph&ograve;ng sẽ bị t&iacute;nh một đ&ecirc;m tiền ph&ograve;ng.');
